<p>CNET 是一个 C99 开发的的面向 iot 设备设计的深度学习推理库，实现深度学习算法在 iot 设备上的快速部署。</p>
<h2 id="_1-使命" tabindex="-1"><a class="header-anchor" href="#_1-使命" aria-hidden="true">#</a> 1 使命</h2>
<p>CNET 为 IOT 的 DNN 而生，是业界首个面向 IoT 完善的 dnn 框架</p>
<h2 id="_2-主要特点" tabindex="-1"><a class="header-anchor" href="#_2-主要特点" aria-hidden="true">#</a> 2 主要特点</h2>
<ul>
<li>C 语言开发， 极高的性能和兼容性</li>
<li>极简设计，高效的内存管理，清晰的架构设计</li>
<li>易于扩展，模块话设计，轻松完成裁剪和扩展</li>
<li>轻便， 完整的二进制库不到 300kb</li>
<li>可靠，完善的内存监测测试， 保证无内存泄露</li>
<li>完善，提供高达 60 种操作实现，支持现有的大量模型</li>
<li>高效，汇编优化，KPU 支持</li>
</ul>
<h2 id="_3-支持情况" tabindex="-1"><a class="header-anchor" href="#_3-支持情况" aria-hidden="true">#</a> 3 支持情况</h2>
<ul>
<li>完全兼容 ncnn 二进制模型， 支持导入 Caffe/Pytorch/Omnx/Mxnet/Tensorflow/MNN 模型；</li>
<li>全面量化支持，支持后量化训练, 支持所有操作量化， 支持 FP32 及 INT8/UINT8 推理混合</li>
<li>支持 K210，ESP32 等主流芯片，理论上完全兼容支持 c99 的所有模块</li>
<li>支持 ARM A 系列性能 CPU 及 Intel 系列高性能 CPU 加速， 加速 30-100 倍</li>
<li>支持分类, 目标检测， 目标分割, 人脸识别， 车牌识别等主流算法</li>
</ul>
